export default function TechMarque() {
  return (
    <>
      <div className="flex justify-center items-center border border-neutral-800 bg-[rgba(248,248,248,0.01)]">
        <Skeleton />
      </div>
    </>
  );
}

const Skeleton = () => {
  const scale = [1, 1.1, 1];
  const transform = ["translateY(0px)", "translateY(-4px)", "translateY(0px)"];
  const sequence = [
    [
      ".circle-1",
      {
        scale,
        transform,
      },
      { duration: 0.8 },
    ],
    [
      ".circle-2",
      {
        scale,
        transform,
      },
      { duration: 0.8 },
    ],
    [
      ".circle-3",
      {
        scale,
        transform,
      },
      { duration: 0.8 },
    ],
    [
      ".circle-4",
      {
        scale,
        transform,
      },
      { duration: 0.8 },
    ],
    [
      ".circle-5",
      {
        scale,
        transform,
      },
      { duration: 0.8 },
    ],
  ];

  useEffect(() => {
    animate(sequence, {
      // @ts-ignore
      repeat: Infinity,
      repeatDelay: 1,
    });
  }, []);
  return (
    <div className="p-8 overflow-hidden h-full relative flex items-center justify-center  ">
      <div className="flex flex-row shrink-0 justify-center items-center gap-10">
        <Container className="h-24 w-24 circle-1">
          <ReactSvg className="h-12 w-12 " />
        </Container>
       
        <Container className=" h-24 w-24 circle-3">
          <NodeLogo className="h-12 w-12 text-white" />
        </Container>
        <Container className="h-24 w-24 circle-5">
          <NextLogo className="h-12 w-12 " />
        </Container>
         <Container className="h-24 w-24 circle-4">
          <ExpressJs className="h-12 w-12 " />
        </Container>
        <Container className="h-24 w-24 circle-2">
          <SqlLogo className="h-12 w-12 text-white" />
        </Container>
         <Container className="h-24 w-24 circle-2">
          <MongoDBLogo className="h-12 w-12 " />
        </Container>


       
      </div>
    </div>
  );
};
const Sparkles = () => {
  const randomMove = () => Math.random() * 2 - 1;
  const randomOpacity = () => Math.random();
  const random = () => Math.random();
  return (
    <div className="absolute inset-0">
      {[...Array(12)].map((_, i) => (
        <motion.span
          key={`star-${i}`}
          animate={{
            top: `calc(${random() * 100}% + ${randomMove()}px)`,
            left: `calc(${random() * 100}% + ${randomMove()}px)`,
            opacity: randomOpacity(),
            scale: [1, 1.2, 0],
          }}
          transition={{
            duration: random() * 2 + 4,
            repeat: Infinity,
            ease: "linear",
          }}
          style={{
            position: "absolute",
            top: `${random() * 100}%`,
            left: `${random() * 100}%`,
            width: `2px`,
            height: `2px`,
            borderRadius: "50%",
            zIndex: 1,
          }}
          className="inline-block bg-black dark:bg-white"
        ></motion.span>
      ))}
    </div>
  );
};

